import BoxAdopt from "../components/BoxAdopt/BoxAdopt"
import pepisMonos from '../components/assets/pepis-monos.jpeg'


const Sponsor = () => {





    return (
        <div>
            <BoxAdopt
                title={'Ayúdanos apadrinando'}
                img={pepisMonos}
                button={'Apadrina'}
                text={'Liberados de una bolsa, de un motor de coche, emparedados, tabicados, lanzados desde una ventanilla, escondidos en alcantarillas, arrojados en cubos de basura…, nuestros gatos salen de situaciones terroríficas, del abandono, víctimas  de la crueldad o de la indiferencia humana.'}
                text2={'Uno de nuestros objetivos principales es buscar, gestionar y facilitar su vida en bienestar y respeto. Intentamos conseguir para ellos humanos que compartan su hogar, donde puedan vivir con tranquilidad el resto de sus vidas. Lamentablemente y a pesar de nuestros esfuerzos siempre tenemos en nuestras casas de acogida más animales que adoptantes, animales a los que hay que atender y cuidar.'}
                text3={'Adoptar y tener un animal en casa supone una gran responsabilidad y hay muchas circunstancias en la vida en las que, aunque se quiera, no es posible hacerlo. Sin embargo, se puede ayudar de otras maneras, entre ellas apadrinar/amadrinar un animal.'}
                li={'Puedes ayudar a salvarle la vida a un gato sin tenerlo en casa.'}
                li2={'Si tu apadrinado es adoptado o cruza el arcoiris, serás informado.'}
                li3={'Apadrinando nos ayudas a que los gatos vivan una vida plena, feliz y que no les falte de nada.'}
                li4={'Puedes hacerlo desde sólo 8€/mes y, con eso, puedes salvar una vida.'}
            />

        </div>
    )
}

export default Sponsor
